// HasContestParticipants applies the HasEdge predicate on the "contest_participants" edge.
func HasContestParticipants() predicate.Contest {
	return predicate.Contest(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, ContestParticipantsTable, ContestParticipantsColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasContestParticipantsWith applies the HasEdge predicate on the "contest_participants" edge with a given conditions (other predicates).
func HasContestParticipantsWith(preds ...predicate.ContestParticipant) predicate.Contest {
	return predicate.Contest(func(s *sql.Selector) {
		step := newContestParticipantsStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Contest) predicate.Contest {
	return predicate.Contest(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Contest) predicate.Contest {
	return predicate.Contest(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Contest) predicate.Contest {
	return predicate.Contest(sql.NotPredicates(p))
}
